import { configureStore } from "@reduxjs/toolkit";
import reductorApp from "../redux/app/appSlice";
import reductorAuth from "../redux/auth";

export default configureStore({
  reducer: {
    app: reductorApp,
    auth: reductorAuth,
  },
});
